import React from 'react';
import Container from '@material-ui/core/Container';
import axios from "axios";

const Bbs: React.FC =  () => {

  const users = () => {
    axios.get('https://jsonplaceholder.typicode.com/users').then((res) => {
      console.log(res)
    })
  }

  return (
    <React.Fragment>
      <main>
        <Container>
          <button onClick={users}>すいっち</button>
          {/* <button onClick={user1}>すいっち</button> */}
          <div class="post" id="2" data-date="NG" data-userid="ID:8vWWOgO70" data-id="2">
            <div class="meta">
              <span class="number">2</span>
              <span class="name">
                <b><a href="mailto:sage">ニューノーマルの名無しさん</a></b>
              </span>
              <span class="date">2021/05/24(月) 12:55:00.32</span>
              <span class="uid">ID:8vWWOgO70</span>
            </div>
            <div class="message">
              <span class="escaped"> ソース　ツイッターｗ </span>
            </div>
          </div>
        </Container>
      </main>
    </React.Fragment>
  );
}

export default Bbs;
